import React from 'react';
import PropTypes from 'prop-types';

const CertificateCard = ({ title, issuer, issueDate, credentialId, skills, image, verifyLink }) => (
  <div className="border border-[#ABB2BF] group hover:border-[#C778DD] transition-colors">
    <div className="aspect-video bg-[#282C33] overflow-hidden">
      <img 
        src={image} 
        alt={title}
        className="w-full h-full object-cover group-hover:scale-105 transition-transform duration-300"
      />
    </div>
    <div className="p-6">
      <h3 className="text-xl font-bold text-white mb-2">{title}</h3>
      <div className="space-y-2 mb-4">
        <p className="text-[#C778DD]">{issuer}</p>
        <p className="text-[#ABB2BF] text-sm">Issued {issueDate}</p>
        {credentialId && (
          <p className="text-[#ABB2BF] text-sm">
            Credential ID: <span className="text-[#C778DD]">{credentialId}</span>
          </p>
        )}
      </div>
      {skills && skills.length > 0 && (
        <div className="mb-4">
          <div className="text-[#ABB2BF] text-sm mb-2">Skills:</div>
          <div className="flex flex-wrap gap-2">
            {skills.map((skill, index) => (
              <span key={index} className="text-sm text-[#C778DD]">#{skill}</span>
            ))}
          </div>
        </div>
      )}
      {verifyLink && (
        <a
          href={verifyLink}
          target="_blank"
          rel="noopener noreferrer"
          className="inline-block border border-[#C778DD] px-4 py-2 hover:bg-[#C778DD] hover:text-white transition-colors"
        >
          Show Credential →
        </a>
      )}
    </div>
  </div>
);

CertificateCard.propTypes = {
  title: PropTypes.string.isRequired,
  issuer: PropTypes.string.isRequired,
  issueDate: PropTypes.string.isRequired,
  credentialId: PropTypes.string,
  skills: PropTypes.arrayOf(PropTypes.string),
  image: PropTypes.string.isRequired,
  verifyLink: PropTypes.string
};

const Certificates = () => {
  const certificates = [
    {
      title: "Machine Learning Specialization",
      issuer: "DeepLearning.AI",
      issueDate: "Mar 2025",
      credentialId: "8Y1LCFGYFUQN",
      skills: [
        "Logistic Regression",
        "Artificial Neural Networks",
        "Linear Regression",
        "Decision Trees",
        "Recommender Systems"
      ],
      image: "/images/cert-ml.svg",
      verifyLink: "#"
    },
    {
      title: "Supervised Machine Learning: Regression and Classification",
      issuer: "DeepLearning.AI",
      issueDate: "Mar 2025",
      skills: [
        "Statistical Modeling",
        "Machine Learning"
      ],
      image: "/images/cert-supervised.svg",
      verifyLink: "#"
    },
    {
      title: "Unsupervised Learning, Recommenders, Reinforcement Learning",
      issuer: "DeepLearning.AI",
      issueDate: "Mar 2025",
      image: "/images/cert-unsupervised.svg",
      verifyLink: "#"
    },
    {
      title: "Advanced Learning Algorithms",
      issuer: "DeepLearning.AI",
      issueDate: "Feb 2025",
      image: "/images/cert-advanced.svg",
      verifyLink: "#"
    },
    {
      title: "CCNA: Introduction to Networks",
      issuer: "Cisco",
      issueDate: "Dec 2022",
      image: "/images/cert-cisco.svg",
      verifyLink: "#"
    },
    {
      title: "Regular Expressions in Python",
      issuer: "Coursera",
      issueDate: "Aug 2022",
      credentialId: "GFWM5QA43RY",
      image: "/images/cert-regex.svg",
      verifyLink: "#"
    },
    {
      title: "Exploratory Data Analysis with Seaborn",
      issuer: "Coursera",
      issueDate: "Aug 2022",
      credentialId: "PPMLAYEV47GT",
      image: "/images/cert-seaborn.svg",
      verifyLink: "#"
    },
    {
      title: "Python HackerRank Certificate",
      issuer: "HackerRank",
      issueDate: "Jul 2022",
      credentialId: "68F64C1F92A6",
      image: "/images/cert-python-hr.svg",
      verifyLink: "#"
    },
    {
      title: "SQL (Basic) Hacker Rank Certificates",
      issuer: "HackerRank",
      issueDate: "Jul 2022",
      credentialId: "BF78429C14C9",
      image: "/images/cert-sql-basic.svg",
      verifyLink: "#"
    },
    {
      title: "SQL (Intermediate) HackerRank Certificates",
      issuer: "HackerRank",
      issueDate: "Jul 2022",
      credentialId: "1BC6EB871BF4",
      skills: ["SQL"],
      image: "/images/cert-sql-inter.svg",
      verifyLink: "#"
    },
    {
      title: "Python for Data Science",
      issuer: "NPTEL",
      issueDate: "Mar 2022",
      credentialId: "NPTEL22CS23S34140074",
      skills: [
        "Microsoft Power BI",
        "Data Visualization",
        "Data Science"
      ],
      image: "/images/cert-nptel.svg",
      verifyLink: "#"
    }
  ];

  return (
    <section id="certificates" className="py-20 px-4 md:px-8">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold mb-8">
          <span className="text-[#C778DD]">#</span>certificates
        </h2>
        <div className="grid md:grid-cols-2 gap-8">
          {certificates.map((cert, index) => (
            <CertificateCard key={index} {...cert} />
          ))}
        </div>
      </div>
    </section>
  );
};

export default Certificates;
